import React from "react";

const AboutDedication = () => {
  return (
    <article className="about-dedication">
      <section className="content">
        <h2 className="sub-title">Dedicated</h2>
        <h3>Changing the world together</h3>
        <p>
          We believe that our success is due to our commitment to providing high-quality food and exceptional service. Our menu features a wide range of delicious pizzas,and more, all made with fresh, locally sourced ingredients. We take great care to ensure that each dish is prepared with the utmost attention to detail, so that every bite is as delicious as the last.
          We also understand that great food is only part of the equation. That's why we place a strong emphasis on delivering exceptional service to every customer orders. Our team of dedicated staff members is committed to providing a warm, welcoming atmosphere that makes every customer feel like they are part of the family.
        </p>
      </section>
      <div className="black-glass"></div>
    </article>
  );
}

export default AboutDedication;
